@alimdar82 لعنت ہے ایسے لیڈران پر جن کی اولاد بھی  اپنی ماں کا جنازہ تک نہیں پڑھنے آئ پاکستان 
لعنت ہے ایسے لیڈران پر جن کو جب عالمی سطح پر بات کرنی پڑھ جاے تو جیب میں پرچی لیجانا نہیں بھولتے  
ھھھھھھھہ

@RehamKhan1 یہ ہے ریحام خان کی آڈینٹی 
اب تو پتہ چل ہی گیا ہو گا کے عمران خان کو اللہ نے بہت ہی خوبیوں سے نوازا ہے  عمران خان سے دوستی کرنے والا مشہور تو ہوتا ہی ہے لیکن خاص خوبی جو آج کل پاکستان میں عام ہے 
جس کو سستی شہرت چاہیے عمران خان کے خلاف بونکنا شروع ہوجاتا ہے https://t.co/3lLR05264U

